(1, '64c010b192f37', NULL, 'Search Engines Blocked', 'Warning: AIOSEO has detected that you are blocking access to search engines. You can change this in Settings > Reading if this was unintended.', 'error', '[\"all\"]', NULL, 'blog-visibility', '2023-07-25 18:13:05', NULL, 'Fix Now', 'https://teamlemoine.wpenginepowered.com/wp-admin/options-reading.php', 'Remind Me Later', 'http://action#notification/blog-visibility-reminder', 0, 0, '2023-07-25 18:13:05', '2023-07-25 18:13:05'),
(2, '64c010b19a0ee', NULL, 'Conflicting Plugins Detected', 'Warning: AIOSEO has detected other active SEO or sitemap plugins. We recommend that you deactivate the following plugins to prevent any conflicts:<ul><li><strong>Yoast SEO</strong></li></ul>', 'error', '[\"all\"]', NULL, 'conflicting-plugins', '2023-07-25 18:13:05', NULL, 'Fix Now', 'http://action#sitemap/deactivate-conflicting-plugins?refresh', 'Remind Me Later', 'http://action#notification/conflicting-plugins-reminder', 0, 0, '2023-07-25 18:13:05', '2023-10-24 13:25:21'),
(3, '64dccc2f3a3f6', NULL, 'NEW: Announcing the AIOSEO Analyzer Chrome extension!  🚀', 'Speed up content reviews and technical SEO checks. This new free tool is designed for you!\r\n<br><br>\r\nAIOSEO Analyzer gives you a big-picture view of your SEO, bringing problem areas into sharp focus. It works on both unpublished <em>and</em> published pages.\r\n<br><br>\r\nAnd it’s <strong>100% free!</strong> Download it today from the Chrome Web Store. And take it for a test drive!', 'success', '[\"4-x\"]', 809, NULL, '2023-10-17 20:10:46', NULL, 'Learn More', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Learn%20More', 'Download', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Download', 0, 0, '2023-08-16 13:16:31', '2023-10-24 13:24:27'),
(4, '64dccc2f3cc93', NULL, '🔥 [New] Advanced SEO Tracking with SEO Revisions & Google Updates Integration', 'Track the changes you make to your content and see how it <strong>connects to changes in your search rankings</strong>.\r\n<br><br>\r\nPlus, see <strong>Google Updates on a timeline in Search Statistics</strong>, so you know how they impact your SEO.\r\n<br><br>\r\nWe’ve also added many more new features to version 4.4.0 of AIOSEO. <strong>Upgrade today!</strong>', 'success', '[\"4-x\",\"lite\"]', 801, NULL, '2023-09-19 21:26:06', NULL, 'Learn More', 'https://aioseo.com/announcing-seo-revisions-and-google-updates-integration/?utm_source=WordPress&utm_campaign=seo-revisions-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=seo-revisions-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 0, '2023-08-16 13:16:31', '2023-10-03 23:09:58'),
(5, '64e74a255c618', NULL, '[New] Improved Crawling and Indexing with AIOSEO 4.4.4 🚀', 'Improve your site’s crawlability and indexability with our improved robots.txt editor. With new directives and advanced functionality, ranking your site on search engines just became easier.\r\n<br><br>\r\nWe’ve also added many more new features to version 4.4.4 of AIOSEO. Check out our announcement for more information.\r\n<br><br>\r\nUpgrade to AIOSEO 4.4.4 today!', 'success', '[\"4-x\",\"lite\"]', 832, NULL, '2023-10-17 20:10:46', NULL, 'Learn More', 'https://aioseo.com/greater-robots-txt-file-customization-for-improved-crawlability/?utm_source=WordPress&utm_campaign=robots-editor-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=robots-editor-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-08-24 12:16:37', '2023-10-24 13:24:27'),
(6, '650c77b3185ab', NULL, '[New] TruSEO Highlighter: Instantly locate readability issues! 😮', 'On-page SEO just got easier with our new TruSEO Highlighter! 😮 Turn on the highlighter to instantly find readability issues on a page. 🥳\r\n<br><br>\r\nThis is our most requested feature! With TruSEO highlighter, you’ll instantly find readability issues flagged by AIOSEO.\r\n<br><br>\r\nUpdate to <strong>AIOSEO 4.4.6 TODAY</strong> to simplify SEO & get traction.', 'success', '[\"4-x\",\"lite\"]', 848, NULL, '2023-10-17 20:10:46', NULL, 'Learn More', 'https://aioseo.com/announcing-truseo-highlighter/?utm_source=WordPress&utm_campaign=truseo-highlighter-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=truseo-highlighter-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-09-21 17:04:51', '2023-10-24 13:24:27'),
(7, '6537c58bca776', NULL, 'Elevate Your SEO Strategy: Meet Cornerstone Content in AIOSEO 4.4.8! 🚀🔥', 'Introducing Cornerstone Content – your secret weapon to boost search rankings and dominate your niche. 🏆\r\n<br><br>\r\nBuild <em>authority & expertise</em>, improve <em>crawling and indexing</em>, supercharge your <em>semantic SEO</em>, and more with this game-changing addition in <strong>AIOSEO 4.4.8</strong>.\r\n<br><br>\r\n👇🏻👇🏻 Upgrade today or click to Learn more!\r\n', 'success', '[\"4-x\",\"lite\"]', 860, NULL, '2023-10-17 20:10:46', NULL, 'Learn More', 'https://aioseo.com/new-supercharge-your-seo-and-content-strategy-with-cornerstone-content/?utm_source=WordPress&utm_campaign=cornerstone-content-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=cornerstone-content-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade%20to%20Pro', 0, 0, '2023-10-24 13:24:27', '2023-10-24 13:24:27');

